import {Outlet} from "react-router-dom";
import {Link} from "@nextui-org/react";

function Layout() {
    return (
        <>
            <header className="w-full flex justify-center items-center gap-5 py-5 bg-[#333] text-white">
                Header
                <ul className="flex gap-2">
                    <Link className="border-white border rounded py-2 px-4" href="/">Home</Link>
                    <Link className="border-white border rounded py-2 px-4" href="/about">About</Link>
                    <Link className="border-white border rounded py-2 px-4" href="/contact">Contact</Link>
                </ul>
            </header>
            <div className="w-full flex justify-center py-5">
                <Outlet/>
            </div>
            <footer className="w-full flex justify-center py-5 bg-[#333] text-white">
                Footer
            </footer>
        </>
    );
}

export default Layout;
